import axios from 'axios';

const url = 'http://localhost:5000/users';

export const getUser = (userEmail) => axios.put(url, { email: userEmail });

export const createUser = (userEmail) => axios.put(url + "/new", { email: userEmail, wpm: 0, raceCount: 0 });

export const updateUser = (userEmail, newWpm, newRC) => axios.put(url + "/update", { email: userEmail, wpm: newWpm, raceCount: newRC });
